 ABOUT THE EVENT 
The second installment of Step Afrika!â€™s virtual performance series revisits the pursuit of freedom, deeply embedded within the American experience. The worldwide premiere of Stono, a feature length performance and post show talk back, will debut on facebook and youtube on September 9, 2020 at 8pm/et. Admission is FREE but guests are welcome to support the continued success of Step Afrika! here: https://sforce.co/36jSh7K  ABOUT THE PANEL  Stono will honor the spirit of resistance and activism that remains a critical part of American freedom. The virtual premiere will be immediately followed by a live panel discussion moderated by Lesli Foster (Evening Anchor, WUSA) and joined by C. Brian Williams (Founder and Executive Director, Step Afrika!), Dr. Aimee Cox (Associate Professor of Anthropology and African American Studies, Yale University), Kendall Thomas (Nash Professor of Law, Columbia University Law School) and Bruce Teague (Mayor of Iowa City, IA). Panelists will explore the Stono Rebellion and its relevance to issues regarding political protest and structural inequities that dominate American conversations today. 

